on/v26.jpg','https://d3dqhfr9ucdgd1.cloudfront.net/audio/mb/V25.mp3','This is a wonderful guided imagery to soothe and heal your body and mind, any time you feel overwhelmed or overworked!','AUDIO',0,0,10,'0','0',NULL,'0:02:21',0,1,NULL,NULL,0,0,0,83,1,0,8,2.24,'Both',NULL,NULL),(226,'GUIDED IMAGERY',0,'A Walk With Nature','https://s3.amazonaws.com/101sessions/visualization/v25.jpg','https://d3dqhfr9ucdgd1.cloudfront.net/audio/mb/V26.mp3','Imagining a peaceful walk in a forest can make you feel revitalized, centered, calm, peaceful, and refreshed, - as if you really took that walk!','AUDIO',0,0,10,'0','0',NULL,'0:02:31',0,1,NULL,NULL,0,0,0,77,1,0,8,2.34,'Both',NULL,NULL),(227,'FEEL GOOD POSITIVE THINKING',0,'Aggravated ~ Angry ~ Antagonized ~ Mad ~ Offended ~ Bristling','0','https://s3.amazonaws.com/101sessions/audio/FG/anger.mp4','Anger is a very social emotion; if you can understand its nuances and subtleties, you can function more intelligently in your social world. But if you have too much anger, you\'ll continually offend against the rights of others. Simply listen to EQ Expert Patti Stark, with an open and relaxed state of mind to help you channel that intensity into healthy action.','AUDIO',0,0,0,'0','0',NULL,'0:04:41',0,1,NULL,NULL,0,0,0,84,0,0,9,NULL,NULL,NULL,NULL),(228,'FEEL GOOD POSITIVE THINKING',0,'Afraid ~ Fearful ~ Jumpy ~ Nervous ~ Shaky ~ Unsettled ~ Worried','0','https://s3.amazonaws.com/101sessions/audio/FG/fear.m4a','Fear is a lifesaving emotion that primes your brain, your muscles, and all of your senses for action. If your fear is stuck in a feedback loop, you may become overwhelmed and exhausted by the activation it causes. Simply listen to EQ Expert Patti Stark, work with your fear, understand when it is healthy and appropriate, and when it is repetitive and unhelpful to you.','AUDIO',0,0,0,'0','0',NULL,'0:03:15',0,1,NULL,NULL,0,0,0,85,0,0,9,NULL,NULL,NULL,NULL),(229,'FEEL GOOD POSITIVE THINKING',0,'Grief-stricken ~ Heartbroken ~ Hopeless ~ Inconsolable ~ Morose','0','https://s3.amazonaws.com/101sessions/audio/FG/grief.mp4','Grief arises when you have no choice about letting go, and when you\'re losing something over which you have no control. Grieving is a slow and languid process that takes its own time. As you listen to EQ Expert Patti Stark, you\'ll find support for your grieving process, and you won\'t be hurried or shamed out of your honest emotions.','AUDIO',0,0,0,'0','0',NULL,'0:03:55',0,1,NULL,NULL,0,0,0,86,0,0,9,NULL,NULL,NULL,NULL),(230,'FEEL GOOD POSITIVE THINKING',0,'Ashamed ~ Chagrined ~ Contrite ~ Culpable ~ Embarrassed','0','https://s3.amazonaws.com/101sessions/audio/FG/shame.wav','Shame is the natural emotional consequence of guilt and wrongdoing. If we don\'t know that and don\'t welcome our authentic shame, we\'ll be unable to moderate our our own behavior. We will continually do things we know are wrong and we won\'t have the strength to stop ourselves. In this short audio session, EQ Expert Patti Stark helps you understand the positive aspects of shame.','AUDIO',0,0,0,'0','0',NULL,'0:04:18',0,1,NULL,NULL,0,0,0,87,0,0,9,NULL,NULL,NULL,NULL),(231,'FEEL GOOD POSITIVE THINKING',0,'Guilt-ridden ~ Guilt-stricken ~ Humiliated ~ Mortified - Self-condemning','0','https://s3.amazonaws.com/101sessions/audio/FG/guilt.wav','Guilt is a factual state, not an emotional one. Youâ€™re either guilty or not guilty. If youâ€™re not guilty, thereâ€™s nothing to be ashamed of. However, if you are guilty, and you want to know what to do about the fact of your guilt, then listen to Patti.','AUDIO',0,0,0,'0','0',NULL,'0:05:29',0,1,NULL,NULL,0,0,0,88,0,0,9,NULL,NULL,NULL,NULL),(232,'FEEL GOOD POSITIVE THINKING',0,'Anxious ~ Disquieted ~ Doubtful ~ Edgy ~ Fidgety','0','https://s3.amazonaws.com/101sessions/audio/FG/anxiety.m4a','At its most subtle level, anxiety helps you plan for the future and complete important tasks. In its intense state, your anxiety might set itself into a tizzy of activation. It might spin out and take you from room to room completing three tasks badly and four not at all. In this short saudio ession with EQ Expert Patti Stark, you can calm down a bit, ground and focus yourself.','AUDIO',0,0,0,'0','0',NULL,'0:04:31',0,1,NULL,NULL,0,0,0,89,0,0,9,NULL,NULL,NULL,NULL),(233,'FEEL GOOD POSITIVE THINKING',0,'Confused ~ Curious ~ Disconcerted ~ Disoriented ~ Apprehensive','0','https://s3.amazonaws.com/101sessions/audio/FG/confusion+.mp4','Confusion actually tries to protect you by halting your actions, but it can easily spiral into a persistent and unresolving state. It\'s fine to be confused, but it\'s important to know why confusion appears. Listen to EQ Expert Patti Stark, unmask your confusion, revive your instincts and intuition and discover why you\'re unable to take decisive action.','AUDIO',0,0,0,'0','0',NULL,'0:04:39',0,1,NULL,NULL,0,0,0,90,0,0,9,NULL,NULL,NULL,NULL),(234,'FEEL GOOD POSITIVE THINKING',0,'Depressed ~ Despondent - Downtrodden ~ Drained','0','https://s3.amazonaws.com/101sessions/audio/FG/depression.wav','Depression is, as every emotion is, a message about and a reaction to things that are going on inside or around you. It\'s important to pay attention to that message and deal with whatever is going on. As you listen to EQ Expert Patti Stark, you will be able to focus upon yourself with empathy & view your depression not as a negative commentary about your intrinsic value, but as a vital message about the specific issues you face.','AUDIO',0,0,0,'0','0',NULL,'0:05:44',0,1,NULL,NULL,0,0,0,91,0,0,9,NULL,NULL,NULL,NULL),(235,'FEEL GOOD POSITIVE THINKING',0,'Desirous ~ Cravings - Wishfulness','0','https://s3.amazonaws.com/101sessions/audio/FG/desire+.mp4','This short audio session by EQ Expert Patti Stark, is about realizing that everything you desire is available when you seek fulfillment from the inside rather than from the outside. It\'s about understanding that what you\'re experiencing on the outside is a reflection of what you\'re experiencing on the inside. It\'s about shifting your perspective 180 degrees from outside yourself to inside yourself.','AUDIO',0,0,0,'0','0',NULL,'0:05:36',0,1,NULL,NULL,0,0,0,92,0,0,9,NULL,NULL,NULL,NULL),(236,'FITNESS',0,'Yoga For Athletes: Warm Down','0','https://www.youtube.com/watch?v=s9ThHzLcd1Q&index=4&list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This 10 min sequence led by San Francisco-based yoga expert Pete Guinosso, takes you through your full range of movement and uses static stretches to re-set your muscle length, help get rid of lactic acid build up and keeps your hamstrings flexible and injury free!','VIDEO',0,0,0,'0','0',NULL,'0:09:59',0,1,NULL,NULL,41,0,0,98,1,0,1,NULL,'Both','0-10 mins ','yoga warm down , Pete Guinosso, relax , runners warm down '),(237,'FITNESS',0,'Yoga For Athletes: Warm Down','0','https://www.youtube.com/watch?v=s9ThHzLcd1Q&index=4&list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This 10 min sequence led by San Francisco-based yoga expert Pete Guinosso, takes you through your full range of movement and uses static stretches to re-set your muscle length, help get rid of lactic acid build up and keeps your hamstrings flexible and injury free!','VIDEO',0,0,0,'0','0',NULL,'0:09:59',0,1,NULL,NULL,42,0,0,98,1,0,1,NULL,'Both','0-10 mins ','yoga warm down , Pete Guinosso, relax , runners warm down '),(238,'FITNESS',0,'Yoga For Athletes: Warm Down','0','https://www.youtube.com/watch?v=s9ThHzLcd1Q&index=4&list=PLYS1_re0fKyVBrmNRW04at9fSX0Rl-uAp','This 10 min sequence led by San Francisco-based yoga expert Pete Guinosso, takes you through your full range of movement and uses static stretches to re-set your muscle length, help get rid of lactic acid build up and keeps your hamstrings flexible and injury free!','VIDEO',0,0,0,'0','0',NULL,'0:09:59',0,1,NULL,NULL,43,0,0,98,1,0,1,NULL,'Both','0-10 mins ','yoga warm down , Pete Guinosso, relax , runners warm down '),(239,'FITNESS',0,'Sculpt and Slim','0.07','https://www.youtube.com/watch?v=s3wOXHbAFm0&